import { ShoppingListService } from "../shopping-list/shopping-list.service";
import { Injectable } from "@angular/core";
import { Recipe } from "./recipe.model";
import { Ingredient } from "../share/ingredient.model";

@Injectable()
export class RecipeService {
  private recipes: Recipe[] = [
    new Recipe(
      "The Recipe Number One",
      "This is the recipe descriptions number one",
      "data:image/jpeg;base64,",
      [
        new Ingredient("First Ingredient", 2),
        new Ingredient("Second Ingredient", 7),
      ]
    ),
    new Recipe(
      "The Recipe Name Number Two",
      "This is the recipe descriptions number two",
      "data:image/jpeg;base64,",
      [
        new Ingredient("Second first ingredient", 10),
        new Ingredient("Second second ingredient", 13),
      ]
    ),
  ];

  constructor(private slService: ShoppingListService) {}

  getRecipe() {
    return this.recipes.slice();
  }

  getRecipeNum(index: number) {
    return this.recipes[index];
  }

  addIngredientstoShoppingList(ingredients: Ingredient[]) {
    this.slService.addIngredients(ingredients);
  }
}
